  return (
    <div className="side-panel">
      <div className="side-panel-header">
        <span>Speedster</span>
        <span role="img" aria-label="speed-icon">üèéÔ∏è</span>
      </div>

      <nav className="side-panel-nav">
        <div className="side-panel-nav-item">
          <FaHome className="side-panel-icon" />
